pragma solidity ^0.4.24; // declaring the version of solidity we want to use

// declaring the smart contract
contract my_contract{
    string value;

    constructor() public {
        value = "my value";
    }

    function get() public returns(string) {
        return value;
    }

    function set(string _value) public {
        value = _value;
    }
}

